	function emoji_animation(element, offset, speed) {
		var str = "";
		if (offset % 2 == 0) {
			str = "+";
		} else {
			str = "-";
		}
		str += "="+offset+"px";
		do_velocity(element, {
			left: str
		}, {
			queue: false,
			complete: function() {
				emoji_animation(element, offset+1, speed);
			},
			duration: speed
		});
	}

